e named child has not been registered.</w:t></w:r></w:p><w:p wsp:rsidR="009347A0" wsp:rsidRPr="00C0345D" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0"><w:pPr><w:rPr><w:rFonts w:cs="Tahoma" /><w:lang w:val="EN-US" /></w:rPr></w:pPr><w:r><w:t>One or more of the points listed below needs to be clarified or rectified before registration can be effected.</w:t></w:r></w:p><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0"><w:pPr><w:rPr><w:rFonts w:cs="Tahoma" /><w:lang w:val="EN-US" /></w:rPr></w:pPr></w:p><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0"><w:r><w:t>Please deal with the items </w:t></w:r><w:r wsp:rsidR="00D00C64"><w:t>listed below</w:t></w:r><w:r><w:t> and return (if appropriate) the agreement to the address given above. Please note that the agreement has been allocated a temporary number – this number will remain valid for twelve months from the date of this letter. If the agreement is not returned within such time the temporary number will lapse. [However, this does not mean you will be prevented from entering into an agreement relating to this child at a later date.]</w:t></w:r></w:p><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0"><w:r><w:t>||LISTOFSTOPSFORLETTER||</w:t></w:r></w:p><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0" /><w:p wsp:rsidR="009347A0" wsp:rsidRDefault="009347A0" wsp:rsidP="009347A0"><w:r><w:t>If you require clarification of any point in this letter, or the accompanying sheet